import React from 'react'
import { SvgXml } from 'react-native-svg'
import { WINDOW_WIDTH, WINDOW_HEIGHT } from '../../constants/windowConstants'
import { View } from 'react-native'
import { globalStyles } from '../../styles/GlobalStyles'

const LibrariesSvg = (props) => {
  const { custHeight, custWidth } = props
  const libraries = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" preserveAspectRatio="xMidYMid" width="1607" height="742" viewBox="0 0 1607 742">
  <g>
    <image xlink:href="data:img/png;base64," width="1607" height="742"/>
    <image xlink:href="data:img/png;base64," x="179" y="390" width="1305" height="352"/>
  </g>
</svg>
`

  const LibrariesSvg = () => (
    <SvgXml
      xml={libraries}
      width={custWidth ? custWidth : WINDOW_WIDTH}
      height={custHeight ? custHeight : WINDOW_HEIGHT}
    />
  )
  return (
    <View style={[globalStyles.positionAbsolute, { zIndex: -1 }]}>
      <LibrariesSvg />
    </View>
  )
}

export default LibrariesSvg
